div#app-container a.tag[data-ref="tag1"] {
  color: inherit;
  padding: 2px;
  border-radius: 3px;
  background: rgba(247, 121, 152, 0.3);
}
div#app-container div[data-refs-self*="tag1"] {
  padding: 0.8em;
  border-radius: 20px;
  background: rgba(247, 121, 152, 0.15);
  outline: 3px solid rgba(247, 121, 152, 0.7);
  outline-offset: 3px;
}
/* dark-mode */
div#app-container a.tag[data-ref="tag1"] {
  background: rgba(247, 121, 152, 0.3);
}
div#app-container div[data-refs-self*="tag1"] {
  background: rgba(247, 121, 152, 0.15);
  outline: 3px solid rgba(247, 121, 152, 0.7);
}


